import React from "react";
import { Typography, Box, Stack, Card, CardActions, CardContent, Button } from "@mui/material";
import { Link } from "react-router-dom";

const card = (
  <React.Fragment>
    <CardContent>
      <Typography sx={{ fontSize: 14 }} color="text.secondary" gutterBottom>
        Word of the Day
      </Typography>
      <Typography variant="h5" component="div">
        be
      </Typography>
      <Typography sx={{ mb: 1.5 }} color="text.secondary">
        adjective
      </Typography>
      <Typography variant="body2">
        well meaning and kindly.
        <br />
        {'"a benevolent smile"'}
      </Typography>
    </CardContent>
    <CardActions>
      <Button size="small">Learn More</Button>
    </CardActions>
  </React.Fragment>
);

const Transaction = () => {
	return (
		<div>
			<Box sx={{ p: 2 }}>
				<Stack spacing={1} direction="column" justifyContent="center" alignItems="center">
					<Typography variant="h6">Transaction List</Typography>
					로그인 계정의 Transfer 내역, 히스토리 리스트업
					<Card variant="outlined">{card}</Card>
				</Stack>
			</Box>
		</div>
	);
};

export default Transaction;
